import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route}
    from 'react-router-dom';

import Home from './Home';

class App extends React.Component{

    render() {
        return <Router>
          <Routes>
              <Route exact path='/' element={<Home />} />
          </Routes>
        </Router>
    }

}

export default App;
